import React from "react";
import s from "../Sidebar.module.css";


type PropsType = {
    img: string
    name: string
    id: number
}

const Sidebar = (props: PropsType ) => {

    return (
<div className={s.sidebar}>
    <h3>FRIENDS</h3>
    <span><img src={props.img} /><div id={props.id}>{props.name}</div></span>

</div>
    )}

    export default Sidebar
